import { useState } from "react";

const CollapseDetails = (props) => {
  const [state, setState] = useState(false);
  return (
    <div className="collapse" onClick={() => setState(!state)}>
      <p>{props.title}</p>
      <div className="icon-collapse"></div>
    </div>
  );
};

export default CollapseDetails;
